import React from 'react'
import './hero.scss'

export default function Hero ({children,hero}) {
        return (
            <header className={hero}>
            <h1>Hey, I'm Tiffany</h1>
            {children}</header>


        );

}

Hero.defaultProps = {
    hero: "defaultHero"
}
